import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import PokemonList from '../pokemon/PokemonList';

export default class Dashboard extends Component {
  render() {
    return (
      <div>
        <div className="row">
          <div className="col">
            <Link to="/" className="btn btn-primary mb-3">
              Back to Index
            </Link>
          </div>
        </div>
        <div className="row">
          <div className="col">
            <PokemonList />
          </div>
        </div>
      </div>
    );
  }
}
